  return (
    <div className="App">
      <h1>Minha Aplicação React</h1>
      <ul>
        <li>Página Inicial</li>
        <li>Cadastro de Alunos</li>
        <li>Sobre</li>
      </ul>

    </div>
  );
}

export default App;
